import React, { useEffect } from 'react';
import { makeStyles } from '@material-ui/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import {Link} from 'react-router-dom';

import background from '../assets/bg.png'
import liebert from '../assets/liebert.png';

const useStyles = makeStyles(theme => ({
  articleContainer: {
    marginTop: "8vh",
    width: '75%',
    height: "100vh",
    justifyContent: "center",
    alignItems: "center",
    verticalAlign: "center",
  },
  brands: {
    marginTop: "3em",
    justifyContent: "center",
    alignItems: "center",
    display: "flex",
    flexWrap: "wrap",
  },
  brandName: {
    color: theme.palette.common.blue,
    fontSize: "2em",
    fontFamily: "Raleway",
    fontWeight: 0,
  },
  brandDesc: {
    color: theme.palette.common.gray,
    fontSize: "1em",
    fontFamily: "Raleway",
    fontWeight: 0,
  },
  logo: {
    margin: "2em"
  }
}));

const Home = () => {
  const classes = useStyles();

  useEffect(() => {
    document.body.style = `background-image: url("${background}")`;
  }, []);

  return (
    <>
      <Grid container spacing={2} alignItems="stretch" justifyContent="center" style={{height: "100%"}}>
        <Paper elevation={0} className={classes.articleContainer}>
          <Box className={classes.brands}>
            <Grid item xs={4}>
              <Button component={Link} to="/" >
                <img alt="liebert" src = {liebert} className = {classes.logo}/>
              </Button>
            </Grid>
            <Grid item xs={4}>
              <Typography className={classes.brandName} component="p" >LIEBERT</Typography>
              <hr style={{
                color: "theme.palette.common.blue",
                backgroundColor: "theme.palette.common.blue",
                height: 5
                }}
              />
              <Typography className={classes.brandDesc} component="p" > - Precision AC units</Typography>
              <Typography className={classes.brandDesc} component="p" > - Uninterruptible Power System (UPS)</Typography>
              <Typography className={classes.brandDesc} component="p" > - Power Distribution Units</Typography>
              <Typography className={classes.brandDesc} component="p" > - Monitoring</Typography>
            </Grid>
          </Box>
          <Box className={classes.brands}>
            <Typography className={classes.brandName}>SERESCO</Typography>
          </Box>
          <Box className={classes.brands}>
            <Typography className={classes.brandName}>FRESH-AIRE UV</Typography>
          </Box>
        </Paper>
      </Grid>
    </>
  );
};

export default Home;
